import React from "react";
import axios from "axios";

import MealCard from "../components/MealCard";

class MealList extends React.Component {
  state = {
    Meals: [{ meal_name: "", description: "", price_tag: "" }],
    list: ["a"],
  };

  componentWillMount() {
    axios.get("https://shop-281014.nw.r.appspot.com/api/").then((res) => {
      this.setState({
        Meals: res.data,
        list: ["b"],
      });
      console.log(res.data);
      console.log(this.state.Meals[0].meal_name);
    });
  }

  render() {
    console.log(this.state.Meals[0]);
    return (
      <MealCard
        meal_name={this.state.Meals[0].meal_name}
        description={this.state.Meals[0].description}
        price_tag={this.state.Meals[0].price_tag}
      />
    );
  }
}

export default MealList;
